import React from 'react';
import './Competencia.css';
const Competencia  = () => {
    return (
        <section className="competencia">
            <h2>Habilidades</h2>
            <ul>
                <li>Node.js</li>
                <li>Java</li>
                <li>API Rest</li>
                <li>React</li>
                <li>Git e GitHub</li>
                <li>HTML e CSS</li>
            </ul>
        </section>
    );
};

export default Competencia ;
